import React, { FC } from 'react';

type Props = {
  children?: string;
};

const HighlitedText: FC<Props> = ({ children }) => (
  <div className="HighlitedContainer">
    <h1 className="HighlitedText">{children}</h1>
  </div>
);

export default HighlitedText;
